import Add from './add';
import Password from './password';

import './body.css';
import './add.css';

class Pass extends Component {
    state = {
        passCorrect: true
    }

    render() {
        if (passCorrect) {
            return (
                <div>
                <div className="main">
                    <h1 className="title">ADD</h1>
                </div>


                <Password/>
                </div>
            );
        }
    }

}

export default Pass;
